import React,{ useState } from 'react' ;
import PlayButton from './PlayButton';


function Table({p})
{   
    const [value,setValue] = useState("") ;
    console.log(p)
    if(p == "undefined")
    {   
        setValue(value = p)
    }

    return(
        <div className="table-box">
            <p> {value} </p>
            <table className="table">
            <tbody>
                <tr>    
                    <td> <PlayButton position="0" /> </td>
                    <td> <PlayButton position="1" /> </td>
                    <td> <PlayButton position="2" /> </td>
                </tr>
                <tr>
                    <td> <PlayButton position="3" /> </td>
                    <td> <PlayButton position="4" /> </td>
                    <td> <PlayButton position="5" /> </td>
                </tr>
                <tr> 
                    <td> <PlayButton position="6" /> </td>
                    <td> <PlayButton position="7" /> </td>
                    <td> <PlayButton position="8" /> </td>
                </tr>
            </tbody>
            </table>
        </div>
    )
} 



export default Table ;
